import { Bar } from "react-chartjs-2";

const IncExpChart = () => {
  return (
    <div>
      <Bar
        data={{
          label: ["Income", "Expense"],
          // label: ["Red", "Blue", "Green"],
        }}
        width={600}
        height={400}
        // color={["aqua", "blue"]}
      />
    </div>
  );
};
export default IncExpChart;
